void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    #define col fragColor.rgb
    // Normalized pixel coordinates (from 0 to 1)
    vec2 UV=(fragCoord/iResolution.xy-0.5)*normalize(iResolution.xy);
    bool b=false;
    int y=0;
    for(int i=1;i<200;i++){
        vec2 offs=vec2(sin(float(i)*iTime*0.02),sin(float(i)*(iTime+0.5)*0.02));
        b = b^^(dot(UV+offs,UV+offs)<0.01);
    }
    col=vec3(b^^true);
}
